INSERT INTO `MOVIE` VALUES ('tt0085975','Murder Me, Murder You',1983,'100 min','Gary Nelson','Stacy Keach, Tanya Roberts, Don Stroud, Delta Burke','Mickey Spillane\'s private eye Mike Hammer (Stacy Keach) probes his long-lost love\'s death while seeking their daughter.','http://ia.media-imdb.com/images/M/MV5BMzU4NTI2MjAzMl5BMl5BanBnXkFtZTcwMDkxNzIzMQ@@._V1_SX300.jpg',7.2,0,0,0,0,0,0),('tt0137523','Fight Club',1999,'139 min','David Fincher','Edward Norton, Brad Pitt, Helena Bonham Carter, Meat Loaf','An insomniac office worker looking for a way to change his life crosses paths with a devil-may-care soap maker and they form an underground fight club that evolves into something much, much more...','http://ia.media-imdb.com/images/M/MV5BMjIwNTYzMzE1M15BMl5BanBnXkFtZTcwOTE5Mzg3OA@@._V1_SX300.jpg',8.9,80,7.4,128,32,96,4.2),('tt0332452','Troy',2004,'163 min','Wolfgang Petersen','Julian Glover, Brian Cox, Nathan Jones, Adoni Maropis','An adaptation of Homer\'s great epic, the film follows the assault on Troy by the united Greek forces and chronicles the fates of the men involved.','http://ia.media-imdb.com/images/M/MV5BMTk5MzU1MDMwMF5BMl5BanBnXkFtZTcwNjczODMzMw@@._V1_SX300.jpg',7.2,54,6,120,102,74,3.5),('tt0356910','Mr. & Mrs. Smith',2005,'120 min','Doug Liman','Brad Pitt, Angelina Jolie, Vince Vaughn, Adam Brody','A bored married couple is surprised to learn that they are both assassins hired by competing agencies to kill each other.','http://ia.media-imdb.com/images/M/MV5BMTUxMzcxNzQzOF5BMl5BanBnXkFtZTcwMzQxNjUyMw@@._V1_SX300.jpg',6.5,59,6,122,85,58,3.4),('tt0372784','Batman Begins',2005,'140 min','Christopher Nolan','Christian Bale, Michael Caine, Liam Neeson, Katie Holmes','After training with his mentor, Batman begins his war on crime to free the crime-ridden Gotham City from corruption that the Scarecrow and the League of Shadows have cast upon it.','http://ia.media-imdb.com/images/M/MV5BNTM3OTc0MzM2OV5BMl5BanBnXkFtZTYwNzUwMTI3._V1_SX300.jpg',8.3,85,7.7,225,41,94,3.9),('tt0468569','The Dark Knight',2008,'152 min','Christopher Nolan','Christian Bale, Heath Ledger, Aaron Eckhart, Michael Caine','When the menace known as the Joker wreaks havoc and chaos on the people of Gotham, the caped crusader must come to terms with one of the greatest psychological tests of his ability to fight injustice.','http://ia.media-imdb.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@._V1_SX300.jpg',9,94,8.6,296,20,94,4.4),('tt0478304','The Tree of Life',2011,'139 min','Terrence Malick','Brad Pitt, Sean Penn, Jessica Chastain, Hunter McCracken','The story of a family in Waco, Texas in 1956. The eldest son witnesses the loss of innocence and struggles with his parents\' conflicting teachings.','http://ia.media-imdb.com/images/M/MV5BNTgyNTQzMDEwNV5BMl5BanBnXkFtZTcwMTQxNjI4NA@@._V1_SX300.jpg',6.7,84,8.1,212,41,60,3.3),('tt0482571','The Prestige',2006,'N/A','Christopher Nolan','Hugh Jackman, Christian Bale, Michael Caine, Piper Perabo','Two stage magicians engage in competitive one-upmanship in an attempt to create the ultimate stage illusion.','http://ia.media-imdb.com/images/M/MV5BMjA4NDI0MTIxNF5BMl5BanBnXkFtZTYwNTM0MzY2._V1_SX300.jpg',8.5,76,7.1,142,46,92,4),('tt0649066','The Day That Shark Ate Lobo',1979,'60 min','Dick Harwood','Claude Akins, Brian Kerwin, Mills Watson, Leann Hunley','Lobo schemes to make money off the giant bass in the Orly County lagoon by holding a $200 entry fee fishing contest. Meanwhile, an escaped convict and his moll looking to fetch their ...','N/A',6.5,0,0,0,0,0,0),('tt0699533','String Theory',2005,'60 min','Philip G. Atwell','Michael Chiklis, Glenn Close, Catherine Dent, Walton Goggins','As Shane enlists Vic and his men in the search for the body of a teenaged informant, the disappearance of two cops on patrol begins to look like payback for Monica\'s tough new policies.','http://ia.media-imdb.com/images/M/MV5BMTk0NTcyMzIzM15BMl5BanBnXkFtZTcwNDI3MjczMQ@@._V1_SX300.jpg',5.1,0,0,0,0,0,0),('tt0699535','Tar Baby',20